import React from "react";

const SpotifyPlaylist = ({ title, handleClick, isSelected }) => {
	return (
		<div className={`playlist ${isSelected ? "selected" : ""}`} onClick={handleClick}>
			<p style={{ display: "flex", textAlign: "center", margintop: "3px" }}>{title}</p>
		</div>
	);
};

export default SpotifyPlaylist;
